import React from "react";
import { useGallery } from "../../contexts/galleryContext";

const PhotoList = () => {
  const { photos } = useGallery();
  return (
    <div className="py-10 px-5">
      <div className="grid grid-cols-4 "></div>
    </div>
  );
};

export default PhotoList;
